import React from "react";
import { GoogleLogin } from '@react-oauth/google';
import App from '../App';

class Login extends React.Component {
    constructor(props) {

        super(props);

        this.state = {
            loginSuccess: false,
            user: null,
            profile: null,
        }
    }
    
    componentDidUpdate() {
        conslose.log('componentDidUpdate');
        if (this.state.user) {
        
                fetch(`https://www.googleapis.com/oauth2/v1/userinfo?access_token=${this.state.user.access_token}`, {
                    headers: {
                        Authorization: `Bearer ${this.state.user.access_token}`,
                        Accept: 'application/json'
                    }
                })
                .then((res) => {
                    console.log(res);
                    this.setState({profile: res.data});
                })
                .catch((err) => console.log(err));
            }
      }
    render() {
        return <div>
            {this.state.loginSuccess ? null :<GoogleLogin
            onSuccess={credentialResponse => {
                console.log(credentialResponse);
                this.setState({loginSuccess:true});
            }}
            onError={() => {
                console.log('Login Failed');
            }}
        />}
          {this.state.loginSuccess ?<App /> : null} 
        </div>
    }
}


export default Login;
